-- ----------------------------
-- Table structure for infolist
-- ----------------------------
DROP TABLE IF EXISTS `infolist`;
CREATE TABLE `infolist`
(
    `id`                 int(11) NOT NULL AUTO_INCREMENT,
    `name`               varchar(255) DEFAULT NULL COMMENT '投资人名称',
    `company`            varchar(255) DEFAULT NULL COMMENT '公司名称',
    `email`              varchar(255) DEFAULT NULL COMMENT '公司邮箱',
    `city`               varchar(255) DEFAULT NULL COMMENT '所在城市',
    `phone`              varchar(255) DEFAULT NULL COMMENT '电话',
    `fax`                varchar(255) DEFAULT NULL COMMENT '传真',
    `position`           varchar(255) DEFAULT NULL COMMENT '职位',
    `wechat`             varchar(255) DEFAULT NULL COMMENT '微信',
    `attention`          varchar(255) DEFAULT NULL COMMENT '关注方向',
    `other`              varchar(255) DEFAULT NULL COMMENT '其他信息',
    `stage`              varchar(255) DEFAULT NULL COMMENT '投资阶段',
    `gender`             varchar(255) DEFAULT NULL COMMENT '性别',
    `phone2`             varchar(255) DEFAULT NULL COMMENT '座机',
    `organization`       varchar(255) DEFAULT NULL COMMENT '机构简称',
    `website`            varchar(255) DEFAULT NULL COMMENT '网站',
    `establishment_time` varchar(255) DEFAULT NULL,
    `address`            varchar(255) DEFAULT NULL COMMENT '公司地址',
    `nature`             varchar(255) DEFAULT NULL COMMENT '机构性质',
    `update`             varchar(255) DEFAULT NULL COMMENT '更新时间',
    `status`             int(11) DEFAULT '0' COMMENT '0未处理  1已联系  2有效  3无效',
    `notes`              varchar(255) DEFAULT NULL COMMENT '备注',
    `exed_status`        int(11) DEFAULT '0' COMMENT '1 微信联系 2 发BP 3稍后联系',
    PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14016 DEFAULT CHARSET=utf8 COMMENT='投资人信息';

